INSERT INTO `articles` VALUES ('5', '1', 'Lolos Audit Kemenhub, Pesawat China Merpati Terus Beroperasi  ', '26', '<p>\n	<strong style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \"><img alt=\"\" src=\"http://assets.dev-rumahtiket.com//assets/media/65bca5771d9f0097a2b3cd854ed2df51.jpg\" style=\"float: left; width: 285px; height: 236px; \" />Jakarta</strong><span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">&nbsp;- Kementerian Perhubungan menyatakan pesawat MA-60 buatan China milik PT Merpati Nusantara Airlines lolos audit keselamatan dan dinyatakan laik terbang. Pesawat ini pun dapat terus beroperasi.</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">Demikian disampaikan oleh Kepala Puskom Publik Kemenhub Bambang S.Ervan kepada&nbsp;</span><strong style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">detikFinance</strong><span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">, Senin (23/5/2011).</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">&quot;Jadi pesawat MA-60 ini dari hasil audit sudah dinyatakan layak terbang. Jadi kesebelas pesawat MA-60 milik Merpati masih boleh beroperasi,&quot; tegas Bambang.</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">Bambang mengatakan, secara teknis 11 pesawat MA-60 buatan Xi&#39;an Aircraft Industry yang dimiliki Merpati sudah laik terbang secara teknis. &quot;Jadi Merpati bisa mengoperasikan terus pesawat ini, namun dengan ketentuan syarat yang berlaku dari sisi perawatan dan operasionalnya,&quot; kata Bambang.</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">Saat ini pesawat MA-60 ini beroperasi di 5 kota utama yaitu Medan, Denpasar, Kupang, Makassar, dan Biak.</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">Selain audit keselamatan, saat ini Kemenhub juga telah selesai melakukan audit operasional kepada Merpati. Namun audit ini masih akan dilaporkan dulu ke Dirjen Perhubungan Udara dan Menteri Perhubungan.</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">&quot;Audit ini meliputi audit soal perawatan pesawat oleh Merpati, operasional dan safety management-nya,&quot; jelas Bambang.</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">Pembelian pesawat China oleh Merpati ini menimbulkan kontroversi setelah adanya kecelakaan di Kaiman, Papua.</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">Seperti diketahui, Merpati memiliki 15 pesawat tipe M-60 buatan Xi&#39;an Aircraft Industry China bernilai&nbsp;</span><a href=\"http://www.detikfinance.com/read/2011/05/10/212312/1636829/4/merpati-dapat-15-pesawat-m-60-dari-kemenkeu-hasil-ngutang\" style=\"color: rgb(221, 0, 0); text-decoration: none; font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">US$ 161 juta</a><span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">. Merpati mendapatkan pesawat ini dari Kementerian Keuangan hasil pinjaman dari Bank Of China.</span><br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<br style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \" />\n	<span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">Pesawat berkapasitas 56 penumpang ini dihargai sekitar US$ 11 juta per unit. Saat ini ada 189 pesawat jenis M-60 produksi Xi&#39;an Aircraft Industry yang digunakan di dunia. Ada&nbsp;</span><a href=\"http://www.detikfinance.com/read/2011/05/10/204804/1636815/4/siapa-saja-negara-pengguna-pesawat-m-60\" style=\"color: rgb(221, 0, 0); text-decoration: none; font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">10 negara</a><span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 16px; text-align: left; \">&nbsp;di dunia yang menggunakan pesawat buatan China ini.</span></p>\n', '2012-01-15 06:47:08', '2012-01-17 14:19:57');
COMMIT;

